import React from "react";

export default function ProjectBox() {
  return (
    <div
      style={{
        color: "white",
        width: "25vw",
        height: "20vh",
        backgroundColor: "rgba(255, 255, 255, 0.2)",
        borderRadius: "20px",
        border: "1px solid rgba(255,255,255,0.4)",
        boxShadow: "0px 12px 20px rgba(112, 144, 176, 0.2);",
      }}
    ></div>
  );
}
